import React from "react";

function CryptoCoin({coin}){
    return (
        <div className="CryptoCoin">
            <svg height="130" width="500">
                <ellipse cx="100" cy="70" rx="85" ry="55" fill="black" />
                <text fill="#ffffff" font-size="45" font-family="Verdana" x="50" y="86">{coin.current_price}</text>
            </svg>
        </div>
    )
}

export default CryptoCoin;
